import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeToken, setActiveToken] = useState(0);
  const [showPrediction, setShowPrediction] = useState(false);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveToken(prev => (prev < 5 ? prev + 1 : 0));
      setShowPrediction(true);
      setTimeout(() => setShowPrediction(false), 1000);
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Main Brain Structure */}
      <div style={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '400px',
        height: '400px',
        borderRadius: '50%',
        background: 'radial-gradient(circle at 30% 30%, rgba(147, 197, 253, 0.1), rgba(13, 14, 20, 0.95))',
        border: '2px solid rgba(147, 197, 253, 0.2)',
        overflow: 'hidden',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
      }}>
        {/* Neural Network Grid */}
        <div style={{
          position: 'relative',
          width: '300px',
          height: '300px',
        }}>
          {Array.from({ length: 64 }).map((_, i) => (
            <div
              key={i}
              style={{
                position: 'absolute',
                left: `${(i % 8) * 40}px`,
                top: `${Math.floor(i / 8) * 40}px`,
                width: '8px',
                height: '8px',
                backgroundColor: '#93C5FD',
                borderRadius: '50%',
                opacity: Math.random() * 0.5 + 0.2,
                animation: `pulse ${2 + Math.random() * 2}s infinite ${Math.random() * 2}s`,
              }}
            />
          ))}

          {/* Connection Lines */}
          <svg
            style={{
              position: 'absolute',
              top: 0,
              left: 0,
              width: '100%',
              height: '100%',
            }}
          >
            {Array.from({ length: 30 }).map((_, i) => (
              <line
                key={i}
                x1={Math.random() * 300}
                y1={Math.random() * 300}
                x2={Math.random() * 300}
                y2={Math.random() * 300}
                stroke="#93C5FD"
                strokeWidth="1"
                strokeOpacity="0.2"
                strokeDasharray="4"
              >
                <animate
                  attributeName="strokeOpacity"
                  values="0.2;0.4;0.2"
                  dur={`${2 + Math.random() * 2}s`}
                  repeatCount="indefinite"
                />
              </line>
            ))}
          </svg>
        </div>
      </div>

      {/* Floating Text Tokens */}
      {[
        { text: "Understanding", angle: 0 },
        { text: "Language", angle: 60 },
        { text: "Processing", angle: 120 },
        { text: "Learning", angle: 180 },
        { text: "Generating", angle: 240 },
        { text: "Reasoning", angle: 300 },
      ].map((token, index) => (
        <div
          key={index}
          style={{
            position: 'absolute',
            left: '50%',
            top: '50%',
            transform: `
              rotate(${token.angle}deg)
              translateY(-180px)
              rotate(-${token.angle}deg)
            `,
            padding: '10px 20px',
            backgroundColor: index === activeToken ? 
              'rgba(147, 197, 253, 0.3)' : 
              'rgba(147, 197, 253, 0.1)',
            borderRadius: '20px',
            color: '#FFFFFF',
            fontSize: '14px',
            transition: 'all 0.3s ease',
            boxShadow: index === activeToken ?
              '0 0 20px rgba(147, 197, 253, 0.3)' :
              'none',
          }}
        >
          {token.text}
        </div>
      ))}

      {/* Prediction Beam */}
      {showPrediction && (
        <div style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          width: '400px',
          height: '4px',
          backgroundColor: '#93C5FD',
          transform: `rotate(${activeToken * 60}deg)`,
          transformOrigin: '0 0',
          opacity: 0.5,
          animation: 'fadeInOut 1s ease-in-out',
        }} />
      )}

      {/* Energy Particles */}
      {Array.from({ length: 30 }).map((_, i) => (
        <div
          key={`particle-${i}`}
          style={{
            position: 'absolute',
            width: '3px',
            height: '3px',
            backgroundColor: '#93C5FD',
            borderRadius: '50%',
            left: '50%',
            top: '50%',
            opacity: 0.6,
            animation: `
              particle ${3 + Math.random() * 2}s infinite linear ${Math.random() * 2}s,
              glow 2s infinite ease-in-out ${Math.random()}s
            `,
          }}
        />
      ))}

      {/* Model Stats */}
      <div style={{
        position: 'absolute',
        bottom: '40px',
        left: '50%',
        transform: 'translateX(-50%)',
        display: 'flex',
        gap: '20px',
      }}>
        {[
          { label: 'Tokens', value: '2048' },
          { label: 'Parameters', value: '175B' },
          { label: 'Layers', value: '96' },
        ].map((stat) => (
          <div
            key={stat.label}
            style={{
              backgroundColor: 'rgba(147, 197, 253, 0.1)',
              padding: '8px 16px',
              borderRadius: '12px',
              textAlign: 'center',
            }}
          >
            <div style={{ color: '#93C5FD', fontSize: '12px' }}>{stat.label}</div>
            <div style={{ color: '#FFFFFF', fontSize: '16px' }}>{stat.value}</div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIVisual;
